import React from 'react'
import './SliderImage.css'

function SliderImage() {
    return (
        <div class="sliderimages">
                <div class="images">
                    <img src="/images/slider/slider-1.png" alt="Slider" />
                </div>
            </div>
    )
}

export default SliderImage
